const titlebar_style = document.createElement("style");
document.querySelector("head").appendChild(titlebar_style);
titlebar_style.innerHTML = `
@media (-webkit-device-pixel-ratio: 1), (device-pixel-ratio: 1), (-webkit-device-pixel-ratio: 1.5), (device-pixel-ratio: 1.5), (-webkit-device-pixel-ratio: 2), (device-pixel-ratio: 2), (-webkit-device-pixel-ratio: 3), (device-pixel-ratio: 3) {
	#window-controls .icon {
		width: 10px;
		height: 10px;
	}
}
div.ui div.header div.top-right-nav {
	padding-right: 150px;
}
html.fullscreen div.ui div.header div.top-right-nav {
	padding-right: .75rem;
}
html.fullscreen #window-controls {
	display: none !important;
}
#window-controls {
	z-index: 9999999999999999;
	color: #fff;
	display: grid;
	grid-template-columns: repeat(3, 46px);
	position: absolute;
	top: 0;
	right: 4px;
	height: 32px;
	-webkit-app-region: no-drag;
}
#window-controls .button {
	grid-row: 1 / span 1;
	display: flex;
	justify-content: center;
	align-items: center;
	width: 50px;
	height: 100%;
	user-select: none;
}
#min-button {
	grid-column: 1;
}
#max-button,
#restore-button {
	grid-column: 2;
}
#close-button {
	grid-column: 3;
}
#window-controls .button:hover {
	background: rgba(255, 255, 255, 0.1);
}
#window-controls .button:active {
	background: rgba(255, 255, 255, 0.2);
}
#close-button:hover {
	background: #e81123 !important;
}
#close-button:active {
	background: #bb111f !important;
}
`;

document.getElementById("max-button").addEventListener("click", () => {
	BrowserWindow.getFocusedWindow().maximize();
});
document.getElementById("restore-button").addEventListener("click", () => {
	BrowserWindow.getFocusedWindow().unmaximize();
});
BrowserWindow.getAllWindows().forEach((win) => {
	win.on("maximize", () => {
		document.getElementById("max-button").style.display = "none";
		document.getElementById("restore-button").style.display = "";
	});
	win.on("unmaximize", () => {
		document.getElementById("max-button").style.display = "";
		document.getElementById("restore-button").style.display = "none";
	});
	win.on("enter-full-screen", () => {
		document.getElementById("window-controls").style.display = "none";
		document.querySelector("html").classList.add("fullscreen");
	});
	win.on("leave-full-screen", () => {
		document.getElementById("window-controls").style.display = "";
		document.querySelector("html").classList.remove("fullscreen");
	});
});
document.getElementById("min-button").addEventListener("click", () => {
	BrowserWindow.getFocusedWindow().minimize();
});
document.getElementById("close-button").addEventListener("click", () => {
	ipcRenderer.send("close");
});

const drag = document.createElement("div");
try {
	document.querySelector("#app > div.ui > div").appendChild(drag);
	drag.outerHTML =
		'<div style="-webkit-app-region: drag;width: 100vw;height: 20px;position: absolute;top: 0;left: 0;cursor: move;"></div>';
} catch {
	document.querySelector("body").appendChild(drag);
	drag.outerHTML =
		'<div style="-webkit-app-region: drag;width: 100vw;height: 20px;position: fixed;top: 0;left: 0;cursor: move;"></div>';
}

function toggleFullscreen() {
	let win = BrowserWindow.getFocusedWindow();
	win.setFullScreen(!win.fullScreen);
}
document.querySelector("html").requestFullscreen = toggleFullscreen;
document.exitFullscreen = toggleFullscreen;
